import React from 'react';
import { Typography, Grid, Container } from '@mui/material';

const Experince = () => {
    const stats = [
        {
            count: 1.5,
            label: 'Year of Experience',
        },
        {
            count: 10,
            label: 'Completed Projects',
        },
        {
            count: 50,
            label: 'Expert Employees',
        },

    ];

    return (
        <Container
            maxWidth={false}
            sx={{
                backgroundColor: 'lightgrey',
                py: { xs: 4, md: 0 },
                width: '45vw',
            }}
        >
            <Grid
                container
                spacing={{ xs: 3, md: 1 }}
                justifyContent="center"
                alignItems="center"
            >
                {stats.map((stat, index) => (
                    <Grid
                        item
                        xs={6}
                        sm={3}
                        md={3}
                        key={index}
                        sx={{ textAlign: 'center' }}
                    >
                        <Typography
                            variant="h4"
                            sx={{
                                fontWeight: 'bold',
                                color: 'black',
                                fontSize: { xs: '1.0rem', md: '1.0rem' },
                            }}
                        >
                            {stat.count}+
                        </Typography>
                        <Typography
                            variant="subtitle1"
                            sx={{
                                color: 'black',
                                fontSize: { xs: '0.9rem', md: '1.0rem' },
                                mt: 1,
                            }}
                        >
                            {stat.label}
                        </Typography>
                    </Grid>
                ))}
            </Grid>
        </Container>
    );
};

export default Experince;
